const gridContainer = <div></div>;
function createGrid(w, h, grid) {
  const screenWidth = window.innerWidth;
  const screenHeight = window.innerHeight;
  if (!w && !h) {
    return gridContainer;
  }
  if (screenWidth % w === 0 && screenWidth >= 20) {
    return createGrid(null, h, grid);
  }
  if (screenHeight % h === 0 && screenHeight >= 20) {
    return createGrid(w, null, grid);
  }
  grid.appendChild(grid);
  return createGrid(w + 1, h + 1, grid);
}
console.log(gridContainer);
const Home = () => {
